import { StyleSheet } from "react-native-web";

const styles = StyleSheet.create({
  
    logo:{
        justifyContent:'center',
        alignItems:'center',
        height:300,
        backgroundColor:'#a0abff'
    },
    Image:{
        
        paddingTop:20,
        height:350,
        width:'auto',
    },

  });
export default styles;
